import React, { Component } from "react";

const TableBody = (props) => {
    if (props.response == null) {
        const rows = <tr key={1}>
                        <td>No values are input yet!</td>
                      </tr>
        return <tbody>{rows}</tbody>
    } else {
        Object.keys(props.response.nedbetalingsplan.innbetalinger).forEach(function(key) {
            console.log(props.response.nedbetalingsplan.innbetalinger[key])
        })
        return "hei"
    }
}

class Table extends Component {
    render() {
        const {response} = this.props

    return (
        <table className="table">
            <thead  className="thead">
                <tr>
                    <th scope="col">Termin</th>
                    <th scope="col">Terminbel√∏p</th>
                    <th scope="col">Renter</th>
                    <th scope="col">Avdrag</th>
                    <th scope="col">Restgjeld</th>
                </tr>
            </thead>
            <TableBody response={response} />
        </table>
    )
    }
}


export default Table;
